import React from 'react';
import './_home.scss';



function Home() {
    return (
        <div className="home">
            <header>
                <h1>Welcome to My Website</h1>
            </header>
            <main>
                <section className="content">
                    <p>
                        In this website we check your knowledge on music
                    </p>
                    <button><h2>Private Room</h2></button>
                    <input type="text" placeholder=" "></input>

                </section>
            </main>
            <footer>
                <p>&copy; 2023 Music hackathon Website</p>
            </footer>
        </div>
    );
}



export default Home;
